PORT = 1337

class Proxy(http.server.SimpleHTTPRequestHandler):
    def do_GET(self):
        self.log_request()
        if self.path == "http://info.update.sony.net/HP001/MDRID291601/info/info.xml":
            self.wfile.write(b"HTTP/1.1 200 OK\r\n\r\n" + info_xml)
        elif self.path == "http://info.update.sony.net/firmware.bin":
            self.wfile.write(b"HTTP/1.1 200 OK\r\n\r\n" + firmware_bin)
        elif self.path == "http://info.update.sony.net/disclaimer.xml":
            self.wfile.write(b"HTTP/1.1 200 OK\r\n\r\n" + disclaimer_xml)
        elif self.path == "http://downgrader.test/":
            self.wfile.write(b"HTTP/1.1 200 OK\r\n\r\n" + b"The proxy is set up correctly")
        else:
            self.wfile.write(b"HTTP/1.1 404 Not Found\r\n\r\n" + b"Not Found")

def decompress(s):
    return lzma.decompress(base64.b64decode(s))

